import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [seats, setSeats] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:3001/api/seats').then(res => setSeats(res.data));
  }, []);

  return (
    <div>
      <h1>Seat Booking</h1>
      <ul>
        {seats.map(seat => (
          <li key={seat.id}>
            Seat {seat.id}: {seat.booked ? 'Booked' : 'Available'}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
